void draw_background(){
  for(int i=0; i < 120; i++){
    for(int j=0; j < 160; j++){
      int index = (i*160 + j)*2;
      short int color = (short int)((background[index+1] << 8) & (0xFF00)) | (short int)(background[index] & 0xFF);
      for(int m=0; m<2; m++){
        for(int n=0; n<2; n++){
          plot_pixel(j*2+m,i*2+n,color);
        }
      }
    }
	}
}

void draw_charater(int x_location, int y_location){
  for(int i=0; i<17; i++){
    for(int j=0; j<16; j++){
      if(character_color[i][j]!=T)
        plot_pixel(x_location+j, y_location+i, character_color[i][j]);
    }
  }
}

void draw_laser(int x_location, int y_location, int direction){
  for(int i=0; i < 17; i++){
    for(int j=0; j < 29; j++){
      int index = (i*29 + j)*2;
      short int color = (short int)((laser[index+1] << 8) & (0xFF00)) | (short int)(laser[index] & 0xFF);
  		if(color != 0x0000){
			if(direction == 0){
				plot_pixel(x_location+j, y_location+i, color);
			}else if(direction == 1){
				plot_pixel(x_location-j, y_location-i, color);
			}else if(direction == 2){
				plot_pixel(x_location+i, y_location+j, color);
			}else if(direction == 3){
				plot_pixel(x_location-i, y_location-j, color);
			}
  		}
    }
  }
}

