void draw_line(int x0, int y0, int x1, int y1, short int line_color)
{	
	int y_step;
	int is_steep;
	if (abs(y1-y0) > abs(x1-x0))
	{
		is_steep=TRUE;
	}
	else
	{
		is_steep=FALSE;
	}
	
	if (is_steep==TRUE)
	{
		swap (&x0, &y0);
		swap (&x1, &y1);
	}
	if (x0 > x1)
	{
		swap (&x0, &x1);
		swap (&y0, &y1);
	}
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax/2);
	if(y0<y1)
		y_step = 1;
	else
		y_step = -1;
	int y=y0;
	for(int x = x0; x <= x1; x++)
	{
		if(is_steep==TRUE)
			plot_pixel(y, x, line_color);
		else
			plot_pixel(x, y, line_color);
		error = error + deltay;
		if(error>0)
		{
			y=y+y_step;
			error= error-deltax;
		}
	}
}

void wait_for_vsync()
{
	volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
	register int status;
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr + 3);

	while ((status & 0x01) != 0)
	{
		status = *(pixel_ctrl_ptr + 3);
	}
}

void swap(int * x, int * y)
{
	int temp = *x;
	*x = *y;
	*y = temp;
}

