void set_A9_IRQ_stack(void) {
	int stack, mode;
	stack = 0x40000;
	mode = INT_DISABLE | IRQ_MODE;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
	/* set banked stack pointer */
	asm("mov sp, %[ps]" : : [ps] "r"(stack));
	/* go back to SVC mode before executing subroutine return! */
	mode = INT_DISABLE | SVC_MODE;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

void enable_A9_interrupts(void) {
	int status = SVC_MODE | INT_ENABLE;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

void config_GIC(void) {
	int address; // used to calculate register addresses
	/* configure the HPS timer interrupt */ *((int *)0xFFFED8C4) = 0x01000000;
	*((int *)0xFFFED118) = 0x00000080;
	/* configure the FPGA interval timer and KEYs interrupts */ *((int *)0xFFFED848) = 0x00000101;
	*((int *)0xFFFED108) = 0x00000300;
	// Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
	// priorities
	address = MPCORE_GIC_CPUIF + ICCPMR;
	*((int *)address) = 0xFFFF;
	// Set CPU Interface Control Register (ICCICR). Enable signaling of
	// interrupts
	address = MPCORE_GIC_CPUIF + ICCICR;
	*((int *)address) = ENABLE;
	// Configure the Distributor Control Register (ICDDCR) to send pending
	// interrupts to CPUs
	address = MPCORE_GIC_DIST + ICDDCR;
	*((int *)address) = ENABLE;
}

void __attribute__((interrupt)) __cs3_isr_irq(void) {
    // Read the ICCIAR from the processor interface
    int address = MPCORE_GIC_CPUIF + 0xc;
    int int_ID = *((int *)address);
    if (int_ID == 73) // check if interrupt is from the KEYs
        key_ISR();
	else if(int_ID == 29)
		Timer_ISR();
    else
        while (1); // if unexpected, then stay here

    // Write to the End of Interrupt Register (ICCEOIR)
    address = MPCORE_GIC_CPUIF + 0x10;
    *((int *)address) = int_ID;

    // Return from interrupt
    return;
}


void key_ISR(){
	volatile int *push_button_ptr = (int *)0xFF20005C;
	int push=*push_button_ptr;
	if(push==0b0001)
		key0_ISR();
	if(push==0b0010)
		key1_ISR();
	if(push==0b0100)
		key2_ISR();
	if(push==0b1000)
		key3_ISR();	
	*push_button_ptr=push;
}

void key0_ISR(){
	key0_pressed=!key0_pressed;
	if(key0_pressed)
		key3_pressed=false;
}
	
void key1_ISR(){
	key1_pressed=!key1_pressed;
	if(key1_pressed)
		key2_pressed=false;
}

void key2_ISR(){
	key2_pressed=!key2_pressed;
	if(key2_pressed)
		key1_pressed=false;
}

void key3_ISR(){
	key3_pressed=!key3_pressed;
	if(key3_pressed)
		key0_pressed=false;
}

